/*global $ */









$(document).foundation({
  accordion:{
    multi_expand: false
  }
});

$(document).ready(function(){
  'use strict';
  var searchBar = $('.search-bar'),
      searchField = searchBar.find('input[type=text]'),
      searchIcon = $('#toggle-search').find('i');

  $('#toggle-search').on('click', function (e){
    e.preventDefault();
    if ( searchIcon.hasClass('fa-close') ) {
      searchIcon.removeClass('fa-close').addClass('fa-search');
      searchBar.velocity('slideUp', {duration: 300});
    } else {
      searchIcon.removeClass('fa-search').addClass('fa-close');
      searchBar.velocity('slideDown', {duration: 300, complete: function(){
        searchField.focus();
      }});
    }
  });

  var toggleFavourite = $('.toggle-favourite, .add-to-favourites');
  toggleFavourite.on('click', function (e){
    e.preventDefault();
    var iconStar = $(this).find('i');
    if ( iconStar.hasClass('fa-star-o') ){
      iconStar.removeClass('fa-star-o').addClass('fa-star');
      showNotification('success', 'Added to Favourites');
    }
    else{
      iconStar.removeClass('fa-star').addClass('fa-star-o');
      showNotification('success', 'Removed from Favourites');
    }
  });

  // Form mass edit for Favourites
  var checkBoxes = $('#items-filter').find('.checkbox');
  $('#all-items-checkbox').on('click', function(){
    if ( $(this).is(':checked') ){
      checkBoxes.prop('checked', true);
    }
    else{
      checkBoxes.prop('checked', false);
    }
  });

  $('.action-apply').on('click', function(e){
    e.preventDefault();
    var removedItems = $('#items-filter').find('input.checkbox:checked').closest('.table-row');
    removedItems.velocity('transition.fadeOut', {duration: 300, stagger: 200});
  });

  // Datepicker for advanced search form
  $('.fdatepicker').fdatepicker();

  // Back to top
  $('#back-to-top').on('click', function(e) {
    e.preventDefault();
    $('body,html').velocity('scroll',400);
  });

  // Refresh live minutes
  var refreshLiveButton = $('#refresh-live');
  var hiddenUpdates = $('.live-updates.hide').find('.panel');
  var liveContainer = $('#live-panel-container');

  refreshLiveButton.on('click', function(e) {
    e.preventDefault();
    $(this).addClass('disabled').find('i').addClass('fa-spin');
    setTimeout( function (){
      var oneUpdate = hiddenUpdates.splice(0,1);
      if (oneUpdate.length > 0) {
        if ( liveContainer.hasClass('desc') ){
          $(oneUpdate).prependTo(liveContainer).hide().velocity('slideDown');
        } else {
          $(oneUpdate).appendTo(liveContainer).hide().velocity('slideDown').velocity('scroll', 400);
        }
      } else {
        showNotification('success', 'Content is up to date');
      }
      refreshLiveButton.removeClass('disabled').find('i').removeClass('fa-spin');
    }, 1500);
  });

  var $latestEntry = '';

  function stickyNotification(type, msg) {
    var n = noty({
        text        : msg,
        type        : type,
        dismissQueue: true,
        layout      : 'topCenter',
        timeout     : false,
        theme       : 'bootstrapTheme',
        closeWith   : ['click','backdrop'],
        maxVisible  : 1,
        modal       : false,
        force       : false,
        killer      : true,
        animation: {
          open: 'animated fadeInDown', // Animate.css class names
          close: 'animated fadeOutUp', // Animate.css class names
        },
        callback: {
          onCloseClick: function() {
            $latestEntry.velocity('scroll',400);
          }
        }
    });
  }

  // Auto-refresh
  if (liveContainer.length) {
    setTimeout(function() {
      showNotification('success', 'Sitting has adjourned');
    }, 1000);
    var timer = setInterval(function() {
      var oneUpdate = hiddenUpdates.splice(0,1);
      if (oneUpdate.length > 0) {
        if ( liveContainer.hasClass('desc') ){
          $(oneUpdate).prependTo(liveContainer).hide().velocity('slideDown');
        } else {
          $(oneUpdate).appendTo(liveContainer).hide().velocity('slideDown');
        }
        stickyNotification('success', 'New updates');
        $latestEntry = $(oneUpdate);
      } else {
        clearInterval(timer);
      }
    }, 7000);
  }

  function showNotification(type, msg) {
    var n = noty({
        text        : msg,
        type        : type,
        dismissQueue: true,
        layout      : 'topCenter',
        timeout     : 2500,
        theme       : 'bootstrapTheme',
        closeWith   : ['click','backdrop'],
        maxVisible  : 1,
        modal       : false,
        force       : false,
        killer      : true,
        animation: {
          open: 'animated fadeInDown', // Animate.css class names
          close: 'animated fadeOutUp', // Animate.css class names
      }
    });
  }

  var accordion = $('.animated-accordion');
  var accordionControl = accordion.find('.animated-accordion-navigation > a');

  accordionControl.on('click', function(e){
    e.preventDefault();
    var el = $(this);
    var siblings = el.parent().siblings();
    var otherEls = siblings.find('> a.active');
    var otherContent = otherEls.next('.content');

    var targetElem = $(el.attr('href'));
    if ( el.hasClass('active') ){
      targetElem.velocity('slideUp', { complete: function (){
        el.removeClass('active');
      }});
    } else {
      if ( otherEls.length ){
        otherContent.velocity('slideUp', { complete: function (){
          otherEls.removeClass('active');
        }});
      }
      el.addClass('active');
      targetElem.velocity('slideDown', { complete: function () {
        el.velocity('scroll', 500);
      }});
    }
  });
});
